import React, { useState } from 'react';

export default function SignupActivtie() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [activity, setActivity] = useState('');
  const [errors, setErrors] = useState({});

  const handleSubmit = (event) => {
    event.preventDefault();
    // Validate form data here
    // If valid, send data to backend API
    console.log('Form submitted:', firstName, lastName, email, password, confirmPassword, activity);
  };

  return (
    <div className="signup-form">
      <h2>Register for Activity</h2>
      <form onSubmit={handleSubmit}>
        <label>First Name:</label>
        <input
          type="text"
          value={firstName}
          onChange={(event) => setFirstName(event.target.value)}
          placeholder="First Name"
        />
        <br />
        <label>Last Name:</label>
        <input
          type="text"
          value={lastName}
          onChange={(event) => setLastName(event.target.value)}
          placeholder="Last Name"
        />
        <br />
        <label>Email:</label>
        <input
          type="email"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
          placeholder="Email"
        />
        <br />
        <label>parent phone number:</label>
        <input
          type="password"
          value={password}
          onChange={(event) => setPassword(event.target.value)}
          placeholder="Password"
        />
        <br />
        <label>Confirm Password:</label>
        <input
          type="password"
          value={confirmPassword}
          onChange={(event) => setConfirmPassword(event.target.value)}
          placeholder="Confirm Password"
        />
        <br />
        <label>Activity:</label>
        <select value={activity} onChange={(event) => setActivity(event.target.value)}>
          <option value="">Select an activity</option>
          <option value="Soccer">Soccer</option>
          <option value="Basketball">Basketball</option>
          <option value="Tennis">Tennis</option>
      
        </select>
        <br />
        <button type="submit">Register</button>
      </form>
      {errors && (
        <div className="error-messages">
          {Object.keys(errors).map((key, index) => (
            <p key={index}>{errors[key]}</p>
          ))}
        </div>
      )}
    </div>
  );
}
